import React from 'react'
import Cards from '../Cards'
import MainSection from '../MainSection'
import './home.css'

function Home() {
    return (
        <div className='home-box'>
            <MainSection className='home-box'/>
            
            <Cards/>
        </div>
    )
}

export default Home
